informacaoComplementar:
4.1. A presente contratação emergencial encontra respaldo no Decreto Municipal nº 858/2025, por meio do qual o Poder Executivo de Barreirinha/AM declarou situação anormal, caracterizada como “Situação de Emergência”, nas áreas afetadas do município, conforme registrado no Formulário de Informações do Desastre – FIDE;
4.2. Tal declaração está fundamentada na Portaria nº 260, de 02 de fevereiro de 2022, alterada pela Portaria nº 3.646, de 22 de dezembro de 2022, do Ministério do Desenvolvimento Regional, que estabelece os procedimentos para reconhecimento de situações de emergência e estado de calamidade pública no âmbito da Defesa Civil;
4.3. O desastre em questão foi classificado como de natureza hidrológica – inundações, conforme Classificação e Codificação Brasileira de Desastres – COBRADE, identificado como Desastre Principal – Inundações (1.2.1.0.0), e enquadrado no Nível II de gravidade, tendo ocasionado impactos significativos que também caracterizaram um desastre secundário de mesma natureza;
4.4. Considerando o cenário crítico provocado pelas inundações, que comprometeram a segurança, a saúde e a subsistência de inúmeras famílias, torna-se imprescindível a adoção de medidas imediatas para assegurar a prestação de assistência humanitária e minimizar os danos à população atingida;
4.5. Nesse contexto, justifica-se a contratação direta, por dispensa de licitação, com fundamento no art. 75, inciso VIII, da Lei nº 14.133/2021, visando à aquisição de combustíveis destinados ao apoio logístico nas ações de socorro e assistência às famílias afetadas pela situação de emergência decorrente das inundações no Município de Barreirinha/AM, incluindo o transporte e a entrega de kits de ajuda humanitária.

